ination of two cars in a row passing directly in front of the snake spooked it back towards canal because it wasn\'t there when I went back.  Slowly made three passes and didn\'t see it again..I\'m a field zoologist and this is my 5th python sighting (3rd one alive), so please don\'t think I\'m reporting a cottonmouth.  It was a python, LARGE, and I believe Burmese (can\'t positively say it wasn\'t a rock python, but I know Burmese are common in that area).  One roadkill I measured in the past was 9\' and this one looked bigger than the 9\' one.  I conservatively estimate it was 10\' in length since I saw approx. 4\' of the snake, and that 4\' included its head-thru-lung-area of body, but couldn\'t see the rest of it (behind guardrail).','','','','','Unknown','Web Report','','Introduced','','','Expertise','Credible','Verified','FWCC Exotic Species Database','30 Sep 2019','','','0','','',''),(8275470,'matthew mccollister National Park Service, Big Cypress National Park','Burmese python','Python molurus ssp. bivittatus','Positive','13 Aug 2018','','27 Sep 2019','27 Sep 2019','Miami-Dade, Florida, United States',25.8014,-80.8691,'WGS84     ','0','Google Maps GPS','','','','','','','','','','','','','','','','','','Big cypress np','','5','','','Unknown','iPhone','','Introduced','','','Photographs','Verified','Verified','FWCC Exotic Species Database','27 Sep 2019','','','','','',''),(8275376,'Mark Danaher US Fish and Wildlife Service','Burmese python','Python molurus ssp. bivittatus','Positive','26 Sep 2019','','26 Sep 2019','','Collier, Florida, United States',26.15294,-81.48449,'WGS84     ','','','','','Right-of-Way                                      ','Dead on road. Observed on the south side of I-75 between Florida Panther National Wildlife Refuge and Picayune Strand State Forest. Snake was in the emergency lane.  Location of snake was approximately 250 feet east of the emergency median crossing.','','','','','','','','','','','','','','Snake was already putrid when discovered at 1414, and likely got hit during the evening of 09/25/2019. Internal organs had been forced out of cloaca and wounds created by vehicle(s) crushing it. Total length was 95.75 inches and snout-vent length was 81.13 inches. Small spurs and relatively skinny body.  Perhaps female, but not confident. Interestingly, I saw an otter dive into the canal on the south side of I-75 when I turned my vehicle into the guard rail opening in order to drive to the snake\'s location.','','','','','Unknown','Web Report','','Introduced','','','Photographs','Verified','Verified','FWCC Exotic Species Database','30 Sep 2019','','','0','','',''),(8275133,'Vanessa McDonough Biscayne National Park','Burmese python','Python molurus ssp. bivittatus','Positive','24 Sep 2019','','25 Sep 2019','','Miami-Dade, Florida, United States',25.46485,-80.30831,'WGS84     ','','','','','Aquatic: Saltwater','Swimming in Biscayne Bay ENE of the end of Convoy Point Channel','','0','15000','','','','','','','','','','','Python was swimming in bay, attempted to climb into the first NPS vessel that observed it (and that was waiting on scene for biologists to arrive and capture).  Python was netted out of water, transferred to a snake bag, then dispatched via captive bolt.','','','','','Unknown','Web Report','','Introduced','','','Photographs','Verified','Verified','FWCC Exotic Species Database','25 Sep 2019','','','0','Biscayne National Park                                                                                                                                                                                                                                         ','',''),(8275088,'matthew mccollister National Park Service, Big Cypress National Park','Burmese python','Python molurus ssp. bivittatus','Positive','23 Sep 2019','','24 Sep 2019','','Collier, Florida, United States',25.84681,-81.38516,'WGS84     ','','','','','','everglades city, fl  gulf coast entrance','','','','','','','','',''