rers. Many hatchlings/eggs were in the nest. The area was slightly higher ground within an overgrown marsh (predominately saw grass with wax myrtle). The \'island\' had Australian pine growing on it. There is a county dump nearby that likely harbors a lot of rats. There are a lot of moccasin in this area as well. The Crew supervisor said he never saw a python in this area before.','','','','','','','','','','','','','','The adult was approximately 13\'. There were many eggs with live hatchlings in them. It was unclear by talking to the crew (language barrier) how many were hatched vs. still in the eggs at time of siting. All of the unhatched eggs were punctured and the hatchlings were then dispatched. The crew estimated 15+ hatchlings (I got different numbers from different laborers and saw 10-20 eggs myself). All snakes were dispatched by the exotic plant crew. 3 Days later there were no signs of additional live eggs/hatchlings. The adult had a nub for a tail presumably from a previous injury.','','','','','General Public','Web Report','','Introduced','','','Photographs','Verified','Verified','FWCC Exotic Species Database','17 Jul 2018','','','0','on site                                                                                                                                                                                                                                                        ','',''),(7625275,'annette johnson nps','Burmese python','Python molurus ssp. bivittatus','Positive','21 Jun 2018','','21 Jun 2018','','Collier, Florida, United States',25.86153,-81.08062,'WGS84     ','','','','','Edge: Roadside                                    ','2 Km east of Loop roads western entrance.  4.9 Km west of Oasis visitors center.','','','','','','','','','','','','','','I saw 2 men standing over a python on the edge of the road so I pulled over. Vehicle driver who did not want to give his name said he saw the snake on the edge of Hwy 41 with its head up in