 The laborers pulled the snake out of the trunk by its tail and dispatched it. Dallas called me, Ryan Brown, and asked for instructions. I instructed him to count the eggs, destroy them, and to send me a location. Dallas sent these pictures of before and after the eggs were destroyed. Only 8 eggs were located inside of the sabal trunk. The location of the clutch is attached.','','','','','','','','','','','','','','Laborers from Applied Aquatic supervised by Dallas Holmes were treating Brazilian pepper along the north side of I-75 near the parallel canal on May 31, 2017. At approximately 3:05pm laborers spotted the 8-10? python which was startled and retreated into a fallen, hollowed out, sabal palm trunk where it started to coil around its eggs. The laborers pulled the snake out of the trunk by its tail and dispatched it. Dallas called me, Ryan Brown, and asked for instructions. I instructed him to count the eggs, destroy them, and to send me a location. Dallas sent these pictures of before and after the eggs were destroyed. Only 8 eggs were located inside of the sabal trunk. The location of the clutch is attached.','','','','','State Agency','Web Report','','Introduced','','','Photographs','Verified','Verified','FWCC Exotic Species Database','16 Jun 2017','','','0','','',''),(4901341,'Vanessa McDonough Biscayne National Park','Burmese python','Python molurus ssp. bivittatus','Positive','15 Jun 2017','','16 Jun 2017','','Miami-Dade, Florida, United States',25.4633,-80.33333,'WGS84     ','','','','','Coastal','Small snake coiled in a ball on a mangrove tree on the jetty at Biscayne National Park headquarters (Convoy Point)','','0','','','','','','','','','','','','I had no means of taking a photo, however I have experience and can identify this species.  I happened to be walking on the jetty when a visitor reported it to me.  Although I had no snake capture gear with me, I attempted to catch it since it was so small.  It leaped off the tree into the water. I will co