 in the shade until we came along. As we approached it went off under the salt wart foliage. it was seen not too far from bird nesting in between the red mangrove coast and the prairie to the interior of the island. I marked the tree (black mangrove)that it was under with 3 blue flags, the center flag has written in sharpie \"Big Python.\" ','','','','','State Agency','Bulk Data','','Introduced','','','','Credible','Verified','Larry Connor, FWCC','02 Dec 2013','','','','                                                                                                                                                                                                                                                               ','','Adam Chasey, National Audubon Society, personal communication'),(3101889,'Michiko Squires University of Florida','Burmese python','Python molurus ssp. bivittatus','Positive','26 Nov 2013','','27 Nov 2013','04 Mar 2014','Miami-Dade, Florida, United States',25.30393,-80.48847,'WGS84     ','','WAAS GPS','Point','','Edge: Upland/wetland                              ','Southern Glades WEA, C-111 appx 530 m E of C-110','','','','','','1','','','','','','','','Bank of culvert pond (almost like a man-made gator hole) on the northern side of the canal. Encountered around noon, temperature 28 degrees Celsius, partly cloudy. Alligator sunning on a bank of culvert pond had object in mouth. When alligator retreated to the water, we saw that it had a burmese python. It abandoned its food item for our photo documentation. Python has been identified as a male, measuring approximately 2.75m. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','29 Nov 2013','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                        