ogical Survey. 2012. USGS Everglades National Park exotic reptile observation database. U. S. Geological Survey. Davie, FL. (Accessed: 11 October 2012).'),(3067084,'Steve Daskam ','Burmese python','Python molurus ssp. bivittatus','Positive','10 Oct 2013','','14 Oct 2013','','Miami-Dade, Florida, United States',25.76194,-80.73028,'WGS84     ','','WAAS GPS','Point','','River: near shore','Miami-Dade County, US-41 3.62 km E of Shark Valley Rd','','','','','','1','','','','','','','','Male Burmees Python with head raised out of thick grass along headline next to cannel. 7 3/4 foot','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','18 Oct 2013','','','0','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 171670                                         ','Personal Communication'),(3066617,'David` Snow ','Burmese python','Python molurus ssp. bivittatus','Positive','04 Oct 2013','','08 Oct 2013','04 Feb 2014','Collier, Florida, United States',25.90155,-81.29877,'WGS84     ','800','ArcGIS','Point','','Other                                             ','Big Cypress National Preserve, US-41 vicinity of Ochopee Post Office','','','','','','1','','','','','','','','Traveling west bound on Highway 41 from Miami to Naples. About four miles before the speed limit drops to 45 prior to everglade city. Saw a ten foot python stretched across the eastbound lane. ','','','','','State Agency','Bulk Data','','Introduced','','','','Credible','Verified','Larry Connor, FWCC','06 Jan 2014','','','','','','Personal Communication'),(3062477,'James Duquesnel Monroe County Assistant Land Steward','Burmese python','Python molurus ssp. bivittatus','Positive','06 Feb 2010','','25 Sep 2013','17 Oct 2013','Monroe, Florida, United States',25.13434,-80.40433,'WGS84     ','','ArcGIS','Point','','Developed/Disturbed area','Key Largo, SE Marlin Ave 50 m E of US-1','','','','','','1','','','','','','','','Observation of what seemed likely to be a Burmese python was found in search of MCSO Dispatcher\'s Logs: Saturday. February 6. 2010 15:25 COWART, RYAN 9182 MCS010CAD013751 1 MARLIN AVE SOUTH KEY LARGO, MARLIN AVE SOUTH 103.4 OC - SYLVESTRI, JR. (305) 522-2385 I interviewed Joseph R Silvestri on 23 Sep 2013. A home construction contractor, Silvestri lives on SE Marlin Avenue, in Largo Sound Park subdivision (mile marker 103.3). Leaving home to go to a worksite, he noticed a crowd gathering at a new residence he was building at #1 SE Marlin Avenue. Stopping, he asked why they were on his lot, and was told some of them has watched a very large snake disappear into a pile of boulders he had on the site. Using a backhoe he had parked there, he removed boulders from the pile until he saw enough of the snake to identifiy it as a python. He then called the MCSO non-emergency line to report it, and waited until FWC officers arrived and captured the python. FWC officers told Silvestri privately that they would euthanize the snake once they had it away from the public eye. The snake was not measured before it was taken away, but Silvestri said that an article in a local paper the following week mentioned that the snake was a 9 feet 6 inches long Burmese python. One of the officers says the snake is 8\'10\" in the video (Larry Connor, FWCC, personal communication). See this photo voucher (video) on YouTube: http://www.youtube.com/watch?v=snbXJOG1h0U ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','01 Oct 2013','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                  