tatus','Positive','25 Jun 2013','','25 Jun 2013','06 Sep 2013','Miami-Dade, Florida, United States',25.76193,-80.70942,'WGS84     ','','Cell Phone GPS','Point','','','Miami-Dade County, US-41 appx 3.54 km W of L-67','','','','','','1','','','','','','','','DOR ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','25 Jun 2013','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 170761                                         ','Laurie Humphrey, National Park Service, personal communication'),(2988893,'Gary Brumit ','Burmese python','Python molurus ssp. bivittatus','Positive','11 Jun 2013','','18 Jun 2013','','Marion, Florida, United States',29.29364,-81.65196,'WGS84     ','','','','','Edge: Lake                       ','Private paved road crossing over 3 culverts where water drains into canal/lake','','','','','','','','','','','','','','Snake looked to appear at least 10 feet long, we have a one lane private road and the snake was moving across the road as I was cutting grass on edge of road. As it was moving across road it was almost as long as the road is wide. It had dark blotched pattern on full length of body with a lighter tan separating the dark blotched patterns. Diameter body of snake was close to size of my calf, I am 52, 5\'9, 190 lbs ( to give you an idea of my size ), underneath body appeared to be white in color with speckled pattern running along bottom edge. The zero turn mower I was on must have scared it and it was moving from lake area where there is a heavy under brush growth canal. It crossed the road opposite side of lake in a heavy under brush empty lot beside my fathers house. I did not get pictures since I was on mower cutting grass and the snake was moving rapidly away from the sound of mower I assume and disappeared into brush. I know what I saw, it definitely wasn\'t a rattle snake, when I viewed the web site here I immediately identified the snake being a Burmese Python. You are more than welcome to call me anytime, I have a trail cam setup in the area in hoping to cath it on camera for you.','','','','','General Public','Web Report','','Introduced','','','Expertise','Credible','Verified','FWCC Exotic Species Database','22 Jan 2015','','','','','',''),(2986708,'Al Jacks ','Burmese python','Python molurus ssp. bivittatus','Positive','10 Jun 2013','','10 Jun 2013','01 Jul 2013','Okeechobee, Florida, United States',27.21765,-80.79866,'WGS84     ','','ArcGIS','Point','','River: near shore','Okeechobee, Taylor Creek appx 835 m of US-441','','','','','','1','','','','','','','','I saw a large snake about 10 feet long with giraffe like markings dark marks on a tan background. The snake was on the edge of the point/canal on Taylor Creek. When the snake saw me it turned around and took off under the water. The snake took off up the feeder canal. The snake has been seen several times by my neighbor. When he has seen it the snake was traveling across Taylor Creek to some bannana trees on the opposite side of Taylor Creek. This was the first time I have seen it. ','','','','','State Agency','Bulk Data','','Introduced','','','','Credible','Verified','Larry Connor, FWCC','13 Jun 2013','','','','                                                                                                                                                                                                                                                               ','','Personal Communication'),(2953010,'Joe Sheriff ','Burmese python','Python molurus ssp. bivittatus','Positive','07 Jun 2013','','07 Jun 2013','01 Jul 2013','Miami-Dade, Florida, United States',25.23016,-80.43194,'WGS84     ','','Cell Phone GPS','Point','','','Miami-Dade County, U