etology Collection                                                                                                                                                                                                       ','UF 170235                                         ','Felix Collazo, Fish and Wildlife Conservation Commission, personal communication'),(2935825,'FWCC Exotic Species Database Florida Fish and Wildlife Conservation Commission','Burmese python','Python molurus ssp. bivittatus','Treated','30 Jan 2013','','03 Jun 2013','','Miami-Dade, Florida, United States',25.39616,-80.56623,'WGS84     ','','WAAS GPS','Point','','','Frog Pond/L-31 N Transition Lands, Lucky Hammock area appx 20 m W of Aerojet Rd','','','','','','1','','','','','','','','Snake captured. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','','','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 169511                                         ','Personal Communication'),(2935703,'Seth Farris University of Florida','Burmese python','Python molurus ssp. bivittatus','Positive','30 May 2013','','31 May 2013','11 Aug 2014','Miami-Dade, Florida, United States',25.70112,-80.6716,'WGS84     ','','WAAS GPS','Point','','Edge: Roadside                                    ','Everglades National Park, L-67 EXT appx 6.66 km S of US-41','','','','','','1','','','','','','','','Burmese Python, roughly 6-7 ft long on EIRAMP survey on L-67 Ext. Found DOR decapitated and with a stab wound to the head. ','','','','','State Agency','Bulk Data','Python molurus bivittatus','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','31 May 2013','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 170294                                         ','Seth C. Farris, University of Florida, personal communication'),(2935629,'Greg Curry FDEP / RBNERR','Burmese python','Python molurus ssp. bivittatus','Positive','24 May 2013','','30 May 2013','03 Jun 2013','Collier, Florida, United States',26.20198,-81.768,'WGS84     ','','WAAS GPS','Point','','Right-of-Way                                      ','Naples, canal east of Airport Pulling Rd N appx 15 m N of Timberwood Cit','','','','','','1','','','','','','','','FWC Officer Lt. Shea picked up snake that was dead dumped in canal without head. Snake was taken to Rookery Bay freezer. Pictures and report later. ','','','','','State Agency','Bulk Data','','Introduced','','','Specimens','Verified','Verified','Larry Connor, FWCC','31 May 2013','','','','','','Greg Curry, Florida Department of Environmental Protection, personal communication'),(2935588,'Nancy Davis ','Burmese python','Python molurus ssp. bivittatus','Positive','27 May 2013','','29 May 2013','03 Jun 2013','Pinellas, Florida, United States',27.80006,-82.61868,'WGS84     ','','ArcGIS','Point','','Aquatic: Saltwater','Saint Petersburg, bayou adjacent to the Renaissance Vinoy Golf Course','','','','','','1','','','','','','','','Observed the snake in the bayou swimming next to the mangroves adjacent to the Vinoy Golf Course and just to the NW of 990 Bayview Place NE. We could see at least 8 feet of the snake and the rest was under water. My son and I were in his Gheenoe fishing about noon on Monday and had just anchored when he spotted it just behind the boat and took the picture with his phone. That is the only photo we got because the snake was spooked and took off to the north. There is a tidal ditch to the north that runs further to the west which is parallel to the south side of 31st Terrace NE that leads to a golf course lake down by 3090 Walnut Street NE. The north side of the ditch is homes but the south side is the golf course.  I wonder if it is living in there? ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','29 May 2013','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 170287                                         ','Personal Communication'),(2935330,'Bob Golenkow ','Burmese python','Python molurus ssp. bivittatus','Positive','20 May 2013','','20 May 2013','','Martin, Florida, United States',27.11244,-80.25254,'WGS84     ','','','','','Developed/Disturbed area','See sighting description. ','','','','','','','','','','','','','','5\' to 6\' Burmese in storage shed with what appeared to have been some shedding of skin.   Inasmuch as we have a small dog, I did not take a picture as I was trying to keep it from escaping nor did I have a phone to call for assistance, so had to ask someone to call Animal Control.  We were told Animal Control would not do anything and to call for a \'Critter Remover\' at our expense to remove said Burmese Python.   Neighbor had an axe and another neighbor held ','','','','','General Public','Web Report','','Introduced','','','Expertise','Credible','Verified','FWCC Exotic Species Database','22 Jan 2015','','','','','',''),(2935323,'FWCC Exotic Species Database Florida Fish and Wildlife Conservation Commission','Burmese python','Python molurus ssp. bivittatus','Treated','11 May 2013','','20 May 2013','03 Jun 2013','Miami-Dade, Florida, United States',25.42065,-80.46062,'WGS84     ','','GoogleEarth','Point','','Edge: Roadside                                    ','Miami-Dade County, Tennessee Rd (SW 167th Ave) appx 690 m N of Card Sound Rd','','','','','','1','','','','','','','','Jason Leon of Miami was driving on Tennessee Rd/SW 167th Ave south of SW 360th St on Saturday, May 11. At about 23:00, he and his passenger sighted a large Burmese python sticking about three feet out from the brush. He stopped the car, grabbed the snake behind the head and tried to drag it out. The snake began to wrap around his leg so he called for assistance from some people who recreating with him, got a knife, and decapitated the snake. On Monday, he called the FWC WPB Regional office and was forwarded to our Exotic Species Hotline. Cheryl Millet from TNC took the call and gathered initial information. Jeff Fobb from Miami-Dade Fire Rescue arranged to have one of his co-workers pick up the snake from Mr. Leon on Monday evening. Joy Vinci from UF picked up the snake from Jeff Fobb on Tuesday. UF performed a necropsy Wednesday, May 15.    Length: 18? 8\", Weight: 128.26 lbs, Female, Empty stomach, Small, unidentified feather in lower GI tract, No eggs, No microchip. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','20 May 2013','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 170236                                         ','Jason Leon, personal communicaton'),(2935214,'Sara Williams University of Florida','Burmese python','Python molurus ssp. bivittatus','Positive','16 May 2013','','17 May 2013','04 Feb 2014','Miami-Dade, Florida, United States',25.76172,-80.82357,'WGS84     ','','WAAS GPS','Point','','Edge: Roadside                                    ','Miami-Dade County, south side US-41 appx 375 m E of Loop Rd','','','','','','1','','','','','','','','Roadkill animal approximately 6-7 f