verglades National Park The animal was fully exposed basking outside the vegetation line along the south side of the L-29 Canal. The snake was missing its tail up to the anus. The wound was fully healed ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','','','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 169257                                         ','Nicholas Gadbois, personal communication'),(2641298,'LEONARDO SANCHEZ Aeromarine','Burmese python','Python molurus ssp. bivittatus','Positive','02 Dec 2012','','02 Dec 2012','','Miami-Dade, Florida, United States',25.76213,-80.7675,'WGS84     ','','Cell Phone GPS','Point','','','Miami-Dade County, US-41 vicinity of airboat concession at the Miccosukee Restaurant','','','','','','1','','','','','','','','Male Burmese python captured. ','','','','','General Public','Unknown Smartphone','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','04 Dec 2012','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 169189                                         ','Leonardo Sanchez, personal communication'),(2640039,'Ian Bartoszek Conservancy of Southwest Florida','Burmese python','Python molurus ssp. bivittatus','Positive','19 Nov 2012','','21 Nov 2012','','Collier, Florida, United States',26.02586,-81.64078,'WGS84     ','','Reported','Point','','Edge: Roadside                                    ','Naples, US-41 appx 120 m W of Auto Village Rd','','','','','','1','','','','','','','','DOR Burmese python (approx 112 cm) collected along Tamiami Trail... likely hit by vehicle overnight. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','26 Nov 2012','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 169127                                         ','Ian Bartoszek, Conservancy of Southwest Florida, personal communication'),(2640009,'Eamonn Leonard Georgia DNR','Burmese python','Python molurus ssp. bivittatus','Positive','09 Nov 2012','','20 Nov 2012','07 Dec 2012','Charlton, Georgia, United States',31.0289,-81.95425,'WGS84     ','800','GoogleEarth','Point','','Edge: Roadside                                    ','Charlton County, River Rd appx 1.63 km S of Winokur Rd','','','','','','1','','','','','','','','Sighting reported from a news article: Published: 11/09 4:36 pm Updated: 11/09 6:58 pm FOLKSTON, Ga. -- Charles O\'Qinn and Terry Lee have seen many things cross River Road, but they never thought a python would be one of them. \"We didn\'t really know what kind of snake it was. We just knew it was a big one,\" said Lee. They spotted half of it slithering across the rural road Monday. They followed it into the brush and shot it. \"If it got a hold of a grown man, he wouldn\'t have a chance. He was too strong. I couldn\'t even hold it by the tail,\" said O\'Qinn. The pair said the snake was at least 11-foot long and more than a foot around. \"He was real fat. So he has been eating,\" said O\'Qinn. \"They are getting everywhere in South Florida, and they could be up here too,\" said Lee. The python was just outside of the Okefenokee Swamp, but researchers don\'t think that\'s where it originated. \"Pythons can get large enough to eat things like small deer and small children,\" said UNF Biology professor Joseph Butler. Butler studies reptiles and believes this one was released. \"Usually these animals are not going to make it through the winter.\" \"We don\'t need that type of snake in this area. It\'s not native,\" said Lee. The snake\'s bones are still left laying on the side of River Road. And the pair hopes that is the only thing the python left behind. ','','','','','State Agency','Bulk Data','','Introduced','','','Photographs + Specimens','Verified','Verified','Karan A. Rawlins','27 Jul 2013','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 169073                                         ','Registre, D. 2012. 11-foot python found in Charlton County. 09-Nov-2012. WTEV. http://www.actionnewsjax.com/content/topstories/story/11-foot-python-found-in-Charlton-County/6CPBNuCnQEaFuAyWjh9_qg.cspx.'),(2486010,'Larry Bender retired','Burmese python','Python molurus ssp. bivittatus','Positive','13 Nov 2012','','15 Nov 2012','','Miami-Dade, Florida, United States',25.69096,-80.7595,'WGS84     ','','Reported','Point','','Edge: Upland/wetland                              ','Everglades National Park, East Shark Valley Loop Rd appx 7.9 km S of US-41','','','','','','1','','','','','','','','Alligator observed holding or eating a dead python between mile markers 10 and 11. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','16 Nov 2012','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 169071                                         ','Personal 