                                                                                                                                                              ','UF 169170                                         ','Ashley Taylor, Florida Fish and Wildlife Conservation Commission, personal communication'),(2482721,'Blake Russ ','Burmese python','Python molurus ssp. bivittatus','Positive','13 Oct 2012','','16 Oct 2012','09 Nov 2012','Miami-Dade, Florida, United States',25.76196,-80.71853,'WGS84     ','','WAAS GPS','Point','','Right-of-Way                                      ','Miami-Dade County, US-41 appx 4.45 km W of L-67','','','','','','1','','','','','','','','The python was crossing in the middle of the road on Tamiami trail heading South. Python was captured at 9pm. Measured 10\' long and weighed 26 lbs. It appears to be a male. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','16 Oct 2012','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 168798                                         ','Personal Communication'),(2482360,'Kline Kendall ','Burmese python','Python molurus ssp. bivittatus','Positive','05 Oct 2012','','10 Oct 2012','09 Nov 2012','Pinellas, Florida, United States',28.07442,-82.71456,'WGS84     ','','ArcGIS 9.x','Point','','Forests: Mixed                                    ','Palm Harbor, Berkley Ct S appx m S or Freemantle Dr','','','','','','1','','','','','','','','We were sitting on our porch and we saw him. Behind the house hanging from a limb and it fell onto the ground with a huge thump. He was huge! About 8-12\' long and about 6 \" around. Beige/Peach in color, looked like a python. I think he just got a squirrel and fell after nabbing it.I have 3 cats and a small beagle. I\'m afraid after he\'s hungry again, he\'ll get one of my pets! We were too afraid to go out there to check it out. It\'s got a lot of ferns and underbrush. Larry Connor, FWCC, sent Kline a set of snake identification images on 12-Oct-2012. Kline indicated that she would select the albino Burmese python if she were to guess. ','','','','','State Agency','Bulk Data','','Introduced','','','','Possible','Verified','Larry Connor, FWCC','15 Oct 2012','','','','','','Personal Communication'),(2463202,'Devin Belliston ','Burmese python','Python molurus ssp. bivittatus','Positive','06 Oct 2012','','07 Oct 2012','09 Nov 2012','Miami-Dade, Florida, United States',25.38426,-80.56596,'WGS84     ','','WAAS GPS','Point','','Edge: Roadside                                    ','Southern Glades WEA, Aerojet Canal Rd (SW 232nd Ave) appx 1.84 km S of SR-9336','','','','','','1','','','','','','','','Burmese python hatchling was collected close to the first gate on SW 232nd Ave at approximately 10:45 at night. The python was caught laying on the west edge of the road facing east. The snake is 33 inches long. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','08 Oct 2012','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 168757                                         ','Personal Communication'),(2463199,'James Duquesnel Monroe County Assistant Land Steward','Burmese python','Python molurus ssp. bivittatus','Positive','27 Sep 2012','','06 Oct 2012','09 Nov 2012','Monroe, Florida, United States',25.08251,-80.44179,'WGS84     ','200','Reported','Point','','Developed/Disturbed area','Key Largo, vicinity of S Ocean Shores Dr and Ocean Bay Dr','','','','','','1','','','','','','','','The Florida Keys Free Press published a photo and caption under the headline \"Another Python\" on page 8 of the paper\'s October 3, 2012 edition. When I reported this record to EDDMaps, the photo and caption were available online at: http://pdf.keysnews.com/weeklys/freepress.pdf Just in case that is no longer the case: The photo shows a man holding the snake by its tail. The man (approximately 5\'9\" tall, according to Ms. Dillon) has his arm extended upwards at a 45 degree angle, and the snake\'s head does not quite reach the ground The published estimated length of \"almost seven feet\" appears reasonable. Below the photo is the following caption: \"Key Largo resident Beverly Dillon found an almost 7-foot python in front of her house Thursday, Sept. 28, after workers began clearing a lot across the street from her South Ocean Shores home. \'This great big thing crawled right in front of the street,? Dillon said. ?It was fighting and going nuts.? The workers killed the invasive snake. Officials are beginning to find more and more pythons coming south from Everglades National Park.\" My October 6 telephone call to the witness cited in the caption (Beverly Dillon) produced additional details. The snake was discovered during routine maintenance / clearing of brush on an overgrown vacant lot on South Ocean Shores Drive, Key Largo, Florida. Employees of the landscape maintenance company killed the python, and took the the carcass away when they left, as requested by residents of the adjacent property. Ms. Dillon also mentioned that residents of another home in the neighborhood reportedly own and breed pythons. The location information is intentionally vague as I am not sure if the snake was on the County-owned right-of-way or the adjacent privately-owned vacant lot. It was on the half of South Ocean Shores Drive that is west of Ocean Bay Drive, Key Largo, Florida. The owner of the adjacent private lot was not contacted regarding this report, so the location given is intentionally imprecise, and is shown as intersection of South Ocean Shores Drive and Ocean Bay Drive (accurate within 300 meters).  Larry Connor, FWCC, changed the observation date to 9/27/2012 based on image properties of the iPhone image provided by Beverly Dillon. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','08 Oct 2012','','','0','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 168768                                         ','James G. Duquesnel, U. S. Geological Survey, personal communication'),(2463170,'Seth Farris University of Florida','Burmese python','Python molurus ssp. bivittatus','Positive','04 Oct 2012','','05 Oct 2012','','Collier, Florida, United States',25.81316,-80.88219,'WGS84     ','','Reported','Point','','Right-of-Way                                      ','Big Cypress National Preserve, US-41 appx 7.96 km W of Loop Rd (CR-94)','','','','','','1','','','','','','','','Yoy on US 41 within Big Cypress National Preserve approximately 7.8km west of the eastern Loop Road entrance. Collected and given to Skip Snow. SVL 80.9 cm TL 96.2 cm Weight 485 g. ','','','','','State Agency','Bulk Data','','Introduced','','','Expertise','Verified','Verified','Larry Connor, FWCC','08 Oct 2012','','','','','','Seth C. Farris, University of Florida, personal communication'),(2462904,'FWCC Exotic Species Database Florida Fish and Wildlife Conservation Commission','Burmese python','Python molurus ssp. bivittatus','Treated','19 Sep 2012','','02 Oct 2012','','Miami-Dade, Florida, United States',25.76095,-80.49847,'WGS84     ','','WAAS GPS','Point','','','Miami-Dade County, US-41 appx 1.71 km W of Krome Ave','','','','','','1','','','','','','','','Female, 4.5 ft, 3.5