python observed and killed by Allen Witt in Big Cypress National Preserve. Python observed along trail in Gum Slough. Python killed and had partially digested mature white-tailed deer inside. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','24 Sep 2012','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 168741                                         ','Tad Bartareau, Florida Fish and Wildlife Conservation Commission, personal communication'),(2418585,'FWCC Exotic Species Database Florida Fish and Wildlife Conservation Commission','Burmese python','Python molurus ssp. bivittatus','Positive','06 Aug 2012','','05 Sep 2012','','Miami-Dade, Florida, United States',25.761,-80.58178,'WGS84     ','','WAAS GPS','Point','','','Miami-Dade County, US-41 appx 9.27 km E of L-67','','','','','','1','','','','','','','','DOR Burmese python, approximately 5\' female. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','','','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 168499                                         ','Nicholas Gadbois, personal communication'),(2418582,'FWCC Exotic Species Database Florida Fish and Wildlife Conservation Commission','Burmese python','Python molurus ssp. bivittatus','Treated','20 Jul 2012','','05 Sep 2012','','Miami-Dade, Florida, United States',25.36763,-80.46198,'WGS84     ','','WAAS GPS','Point','','','Miami-Dade County, US-1 appx 800 m S of SW 424th St','','','','','','1','','','','','','','','Python (seen) on the 18 mile stretch while driving home. It was on the right hand margin in southbound lane. I had vehicles behind me and did not stop. It appeared to be in the 10/11\' range. ','','','','','State Agency','Bulk Data','','Introduced','','','Expertise','Verified','Verified','','','','','','','','Personal Communication'),(2418581,'FWCC Exotic Species Database Florida Fish and Wildlife Conservation Commission','Burmese python','Python molurus ssp. bivittatus','Treated','20 Jul 2012','','05 Sep 2012','','Miami-Dade, Florida, United States',25.40758,-80.5241,'WGS84     ','','WAAS GPS','Point','','','Miami-Dade County, SR-9336 appx 50 m W of C-111E','','','','','','1','','','','','','','','9 ft python on road. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','','','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 168132                                         ','Personal Communication'),(2418030,'James Duquesnel Monroe County Assistant Land Steward','Burmese python','Python molurus ssp. bivittatus','Positive','30 Aug 2012','','03 Sep 2012','11 Sep 2013','Monroe, Florida, United States',25.15473,-80.39095,'WGS84     ','','Reported','Point','','Edge: Roadside                                    ','Key Largo, Pompano Ave appx 280 m W of US-1','','','','','','1','','','','','','','','This python was first observed moving from south to north across Pompano Avenue, a paved street in a relatively quiet neighborhood - the Bowens Addition to Riviera Village subdivision on Key Largo, approximately 300 meters west (bayside) of U.S. Highway Route 1 (a.k.a. State Road 5) mile marker 105. It moved off the cleared right-of-way, and into cover just inside the margin of hardwood hammock at Block 6, Lots 16, 17 and 18 of Bowens Addition to Riviera Village Subdivision. As a former resident of 38 Pompano Avenue (100 feet from where the snake was observed), I would describe this subdivision as heavily wooded despite being 75% developed, and much less than 75% occupied during August, as many residents leave for the summer. Most of the properties at the west end of the subdivision (west of Bay Drive and on Blackwater Sound) are large and many retain remnants of hardwood hammock. Between Bay Drive and US Route 1, many of the homeowners have retained at least large shade trees, some have kept small remnants of the native forest. There are also many undeveloped lots still covered by dense hardwood hammock, with vines and poisonwood (Metopium toxiferum) often making access less than convenient. Any constrictor, as long as it remained undetected by residents, would find ample prey here as there are many free-roaming domestic cats, as well as resident opossums, raccoons, grey squirrels, and abundant non-native rats (Rattus rattus).  On 30-August-2012, at approximately 11:00 PM, Monroe County Sheriff\'s Office (MCSO) Deputy Bryan Cross was conducting routine patrols of Key Largo?s residential neighborhoods when he observed a large snake moving from south to north across a Monroe County right-of-way. Estimating the snake\'s length at 10 feet, Deputy Cross called Florida Fish and Wildlife Conservation Commission (FWC) dispatch for assistance. Responding FWC Officers Jason Rafter, Kip Hoover and Shelton Bartlet were joined by MCSO Sergeant Jason Madnick, and the five officers searched the area until finding the python, at about 11:25 PM, under a brush pile just inside the hardwood hammock of undeveloped lots (across from # 32 Pompano Avenue, Key Largo, FL 33037) and just a few yards from where it had been first observed. The following afternoon (31-Aug-2012), Officer Rafter transferred the live python to United States Geological Survey (USGS) Invasive Species Science biologists James Duquesnel and Michelle McEachern. During the transfer, Duquesnel took several photos (three are attached to this report) of the snake and Officers Rafter and Hoover, assisted by FWC Officer Janet Fernandez, who helped hold the snake for the photo. McEachern then transported the snake to Everglades National Park\'s Dan Beard Center, where Wildlife Biologist Skip Snow confirmed the species identification, and reported the following after his post-mortem examination: mass: 9,448 grams; snout to vent length: 254 cm; total length: 287 cm (9 ft., 4 in.); girth: 25.4 cm. Both ovaries with numerous small follicles (max dia. 8.0 mm, 7.2, 6.9) Oviducts thin and narrow, not at all thick nor muscular. Virgin female. Stomach empty. Moderate amount of fecal material collected from lower GI (frozen), hair observed and numerous large parasitic worms (70% ETOH). Tail collected (frozen) A few mites and one lungworm also collected (70% ETOH) Carcass retained for FLMNH (frozen). AVID scan negative. Body with a few small old scars. The specimen will most likely be deposited in the collection at Florida Museum of Natural History (Gainesville, FL). ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCc','04 Sep 2012','','','1','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 168596                                         ','James G. Duquesnel, U. S. Geological Survey, personal communication'),(2413379,'Alicie Warren Natural Areas Management, Miami-Dade County Parks, Recreation & Open Spaces Dept.','Burmese python','Python molurus ssp. bivittatus','Positive','15 Aug 2012','','16 Aug 2012','06 Aug 2013','Miami-Dade, Florida, United States',25.39489,-80.52725,'WGS84     ','','Reported','Point','','Forests: Hardwood                                 ','Miami-Dade County, Holiday Hammock Unit 5C','','','','','','1','','','','','','','','Natural Areas Management (Miami-Dade County Parks, Recreation & Open Spaces) crew collected this snake in Unit 5C of Holiday Hammock, an Environmentally Endangered Lands Preserve. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','16 Aug 2012','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 168504                                         ','Al�cie Warren, Miami-Dade County Parks, Recreation and Open Spaces, personal communication'),(2411512,'Dominick Dulevich Institute for regional conservation','Burmese python','Python molurus ssp. bivittatus','Positive','03 Aug 2012','','07 Aug 2012','05 Sep 2012','Miami-Dade, Florida, United States',25.46579,-80.52073,'WGS84     ','','ArcGIS 9.x','Point','','','Homestead, vicinity of SW 324th St and SW 203rd Ct','','','','','','1','','','','','','','','Approximately 18 in hatchling captured on back porch of house. ','','','','','State Agency','Bulk Data','','Introduced','','','Voucher Photographs','Verified','Verified','Larry Connor, FWCC','07 Aug 2012','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 168500                                         ','Personal Communication'),(2411199,'FWCC Exotic Species Database Florida Fish and Wildlife Conservation Commission','Burmese python','Python molurus ssp. bivittatus','Treated','19 Jul 2012','','02 Aug 2012','','Miami-Dade, Flori