,'Key Largo, western boundry of Crocodile Lake NWR appx 0.33 km NE of US-1 and CR-905 split','','','','','','1','','','','','','','','On 25 September 2009, Ron Rozar, USGS, and crew, caught a Burmese python in a trap on Key Largo. The animal was a male, with a live measured snout-to-vent length of 185 cm, total length of 207 cm, and a mass of 4.014 kg. The animal was caught in an unbaited, round entrance trap located on a drift fence near the western boundary of the Crocodile Lake NWR (~0.33 km NE of the US 1 - CR 905 split). The UTM coordinates of the capture are 563194; 2784405. The body condition of the snake was good, though its disposition left a little to be desired. The animal was necropsied on 28 September. The animal was a male with testes still developing, ducts thin, not thickened, nor convoluted. Stomach was empty. Three small fecal pellets were collected from the lower GI tract. Mike Rochford (UF) and Skip Snow (ENP) confirmed the id of hair, small bone fragments, and a few very small teeth, to be the remains of a black rat (Rattus rattus). Photos were taken and tissue archived (frozen) for genetics, mercury, etc. PyMo_1401. ','','','','','General Public','Web Report','','Introduced','','','Voucher Photographs','Verified','Verified','','','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 165954                                         ','Skip Snow, National Park Service, personal communication'),(618710,'Skip Snow Everglades National Park','Burmese python','Python molurus ssp. bivittatus','Positive','16 Sep 2009','','23 Sep 2009','21 Dec 2011','Miami-Dade, Florida, United States',25.76197,-80.71278,'WGS84     ','','Reported','Point','                                                                                                         