egrees C. As most wild pythons; was highly agressive. ','','','','','University','Web Report','','Introduced','','','Voucher Photographs','Verified','Verified','','','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 165915                                         ','Joshua Holbrook, Palm Beach Atlantic University, personal communication'),(462630,'Jeffrey Carter Rookery Bay NERR','Burmese python','Python molurus ssp. bivittatus','Positive','27 Dec 2008','','30 Dec 2008','04 Jan 2012','Collier, Florida, United States',26.02109,-81.7012,'WGS84     ','','WAAS GPS','Point','                                                                                                                                                                                                        ','Wetlands: Marsh                                   ','Collier County, Hyw 951 appx 200m S of Shell Island Rd','','','','','','','','','','','','','','','','','','','General Public','Web Report','','Introduced','','','Voucher Photographs','Verified','Verified','','','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 165910                                         ','Jeffrey Carter, Rookery Bay National Estuarine Reserve, personal communication'),(446320,'Michael Renda The Nature Conservancy','Burmese python','Python molurus ssp. bivittatus','Positive','15 Oct 2008','','07 Mar 2010','04 Jan 2012','Palm Beach, Florida, United States',26.93767,-80.17971,'WGS84     ','','Reported','Point','                                                                                                                                                                                                        ','','Jupiter, Sierra Square 9250 W Indiantown Rd','','','','','','','','','','','','','','I did not observe this, but spoke to the animal hospital that retrieved the python (David Hitzig, Busch Wildlife Hospital). The animal was found dead at this shopping area, near the road. The animal was 12 ft in length. The date is approximate.. ','','','','','General Public','Web Report','','Introduced','','','Specimens','Verified','Verified','','','','','','','','Michael Renda, The Nature Conservancy, personal communication'),(414849,'Skip Snow Everglades National Park','Burmese python','Python molurus ssp. bivittatus','Positive','01 Dec 2008','','03 Dec 2008','21 Dec 2011','Volusia, Florida, United States',29.09441,-81.0182,'WGS84     ','','Reported','Point','                                                                                                                                                                                                        ','Forests: Hardwood                                 ','Spruce Creek, Kendrew Dr appx 130 m N of Boggs Ford Rd','','','','','','1','','','','','','','','Observed on a forested private lot behind a residence which is adjacent to a small tributary of Spruce Creek in Port Orange, Volusia Co. Python first seen 2 or 3 Mondays before Thanksgiving. At that time a chainsaw operator stepped on it while cutting some trees on the property. The sawyer recognized it to be a Burmese python because he used to keep them as pets. No one has seen the snake since. The homeowner believes the snake has been eating her free range cats (many of which have gone missing over the last 2 years). Estimated size of the snake was 10\'-12\' approx. 6\" across. No photos available. I provided the home owner with the name and phone number of FWC\'s Jenny Novak Tinell for further advice and assistance. ','','','','','General Public','Web Report','','Introduced','','','','Credible','Verified','','','','','','','','Skip Snow, National Park Service, personal communication'),(145991,'Skip Snow Everglades National Park','Burmese python','Python molurus ssp. bivittatus','Positive','24 Jun 2008','','30 Jun 2008','21 Dec 2011','Monroe, Florida, United States',25.08408,-80.45266,'WGS84     ','','Reported','Point','','Forests: Hardwood                                 ','Key Largo, vicinity of Overseas Highway and Francis Drake Dr','','','','','','1','','','','','','','','At about 1:10 pm on Tuesday, 24 June 2008, the Python Hotline received a call from Sue Nulman, 98610 Overseas Highway (Bayside) Key Largo. Ms. Nulman had found a python on her property in a shaded area attempting to eat one of her \"pet\" birds, one of many wild doves (and other wildlife) she feeds. The Nulman property appears to be rather large and wooded. At around 12:30 pm she saw the python, mostly concealed by leaves, with a dove, dead but not swallowed. Nulman stunned the snake with a blow to the head and then severed the spinal cord. I was in the area so stopped to pick up the carcass, and chat. She expressed concern about the remaining wildlife and the dog, and how to secure the house against pythons. Nulman got the Python Hotline number from a flyer she picked up in Big Cypress. I took the carcass back to the lab and performed a necropsy late in the afternoon. Results are as follows: PyMo_901, a male, some rigor in the carcass, 207.5 cm (TL), 181.0 cm (SVL), with a mass of 3.972 kg and a girth of 18.5 cm. Looks to be near mature, perhaps breeding for the first time this coming winter. No external parasites observed. A couple of large round worms were found in the lower gut, which seem to be associated with a large quantity of fecal material (hair observed). Gut contents were collected and frozen. Mike Rochford and I identified two black rats (Rattus rattus) in the remains collected from the lower gut. The stomach was empty, and a very small amount of unidentified material was collected from the esophagus (also frozen). The carcass was retained (frozen) as a specimen for the FLMNH. Photos were taken by me and by Ms. Nulman (she will email her photos). In general, another rather unremarkable young male Burmese python shows up in Paradise. ','','','','','General Public','Web Report','','Introduced','','','Voucher Specimens','Verified','Verified','','','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 154823                                         ','Skip Snow, National Park Service, personal communication'),(97627,'Skip Snow Everglades National Park','Burmese python','Python molurus ssp. bivittatus','Positive','20 May 2008','','23 May 2008','21 Dec 2011','Miami-Dade, Florida, United States',25.28243,-80.79981,'WGS84     ','','Reported','Point','Everglades                                                                                                                                                                                              ','Other                                             ','Everglades National Park, Paurotis Pond','','','','','','1','','','','','','','','Matt Brien, University of Florida, stopped by Paurotis Pond on the evening of 20 May at 8pm after a survey of croc nesting in the park and witnessed a large alligator (9ft) surface in the middle of the pond with what turned out to be a bloated (and very stinky) python in its mouth, around 9-10ft in length. The gator swam over to the mangroves and began smashing the python around in an attempt to break it into edible portion sizes. Observation only. Nothing recovered. Photos by Matt Brien. ','','','','','General Public','Web Report','','Introduced','','','Voucher Photographs','Verified','Verified','','','','','','Florida Museum of Natural History Herpetology Collection                                                                                                                                                                                                       ','UF 165908                                         ','Skip Snow, National Park Service, personal communication');
